import React from 'react'
import PurchasesRow from './PurchasesRow'

class PurchasesList extends React.Component {

  render() {
    return (
      <div className="container-fluid">
        <ul className="media-list">
          {
            this.props.listado.map((purchases) => {
              return <PurchasesRow key={ purchases.id }
                                  name={ purchases.fullName }
                                  picture={ purchases.pic }
                                  title={ purchases.title }
                                  department={ purchases.department } />
            })
          }
        </ul>
      </div>
    )
  }
}

export default PurchasesList
